import * as React from 'react';
import { Text,TextInput,View, Image,ImageBackground, StyleSheet } from 'react-native';
import { Icon,Button,Card } from 'react-native-elements'
import { Avatar, Accessory } from 'react-native-elements';
import LoginScreen from '../components/Login';
import RegisterScreen from '../components/Register';
const imgbg = require('../assets/fondo.jpg');

export default class Test extends React.Component {
  constructor(props){
    super(props)
    
   
    this.state = {
      cardstate:0
    }
}
  render() {

    return (
          <View style={styles.container}>
              
              <View style={styles.buttonContainer}>
          <Button style={styles.buttonLogin} onPress={() => this.setState({ cardstate: 0})}title="Entrar"></Button>
          <Button style={styles.buttonRegister} onPress={() => this.setState({ cardstate: 1})}title="Registrar"></Button>
         </View>
         <View style={styles.tabsContainer}>
         {this.state.cardstate == 0 ? ( <LoginScreen/> ) : ( <RegisterScreen/> )}
         </View>
        
          </View>        
        
    );
  }
}


const styles = StyleSheet.create({
  container:{
    background:imgbg,
    width:'100%',
    height:'100%'
  },
  buttonLogin:{
    width:'500px',
    height:'10%'
  },
  buttonRegister:{
    width:'500px',
    height:'10%'
  },
  
  buttonContainer: {
   alignSelf:'center',
    width:'50%',
    flexDirection: 'row',
    justifyContent: 'space-between'
  },
  tabsContainer:{
    height:'15%',
    width:'25%',
    alignSelf:'center',

  }
})
